import React from 'react';
import '../css/WhyUs.css';

const WhyUs = () => {
  return (
    <div className="why-us">
      <h2>Why Us</h2>
      <ul>
        <li>Rajasthan is a center of tourism offering vast opportunities.</li>
        <li>Excellent infrastructure with experienced faculties.</li>
        <li>24Ã—7 Wi-Fi and CCTV surveillance.</li>
        <li>Practical training to ensure real-time hospitality exposure.</li>
        <li>Mentorship and teacher-guardian programs for holistic development.</li>
        <li>Highly qualified faculties with both academic and industry exposure.</li>
        <li>Modern, inclusive learning approach catering to all backgrounds.</li>
        <li>Hands-on training in Cuisine, Front Office, Housekeeping, and more.</li>
        <li>One-on-one grooming and personality development support.</li>
        <li>Dedicated cell for health, hygiene, and safety compliance.</li>
        <li>100% placement assistance with alumni in reputed positions.</li>
        <li>Industrial tie-ups with tourism and hospitality leaders.</li>
        <li>Strict anti-ragging and anti-harassment policies in place.</li>
        <li>Fee structure as prescribed by NCHMCT & Board of Governors.</li>
        <li>Vegetarian-only batch available in Food Production Diploma.</li>
      </ul>
    </div>
  );
};

export default WhyUs;
